function norm(s){ return (s||'').toString().toLowerCase().trim(); }
function byThai(a,b){ return a.localeCompare(b,'th'); }

(function fillDropdowns(){
  const agencyEl=document.getElementById('agency'), ptypeEl=document.getElementById('ptype');
  const agenciesRaw = Array.from(new Set(RAW.map(r=> (r.agency||'').trim()).filter(Boolean)));
  const priorityIndex = Object.fromEntries(PRIORITY.map((v,i)=>[v,i]));
  const special = agenciesRaw.filter(a=> priorityIndex[a]!==undefined).sort((a,b)=> priorityIndex[a]-priorityIndex[b]);
  const others = agenciesRaw.filter(a=> priorityIndex[a]===undefined).sort(byThai);
  const agencies = [...special, ...others];
  agencies.forEach(v=>{ const o=document.createElement('option'); o.value=v; o.textContent=v?`‡∏´‡∏ô‡πà‡∏ß‡∏¢‡∏á‡∏≤‡∏ô: ${v}`:''; agencyEl.appendChild(o); });
  const ptypes = Array.from(new Set(RAW.map(r=> (r.ptype||'').trim()).filter(Boolean))).sort(byThai);
  ptypes.forEach(v=>{ const o=document.createElement('option'); o.value=v; o.textContent=v?`‡∏õ‡∏£‡∏∞‡πÄ‡∏†‡∏ó: ${v}`:''; ptypeEl.appendChild(o); });
})();

function agencyOrderKey(ag, priorityIndex){
  if(!ag) return [2, '']; // push empty to end
  if(priorityIndex[ag] !== undefined) return [0, priorityIndex[ag]];
  return [1, ag]; // others sorted by Thai later
}

function render(){
  const q=norm(document.getElementById('q').value),
        ag=(document.getElementById('agency').value||'').trim(),
        pt=(document.getElementById('ptype').value||'').trim(),
        st=(document.getElementById('stay').value||'').trim();
  const priorityIndex = Object.fromEntries(PRIORITY.map((v,i)=>[v,i]));

  let rows=RAW.slice();
  if(ag) rows=rows.filter(r=> (r.agency||'').trim()===ag);
  if(pt) rows=rows.filter(r=> (r.ptype||'').trim()===pt);
  if(st) rows=rows.filter(r=> (r.stay||'').trim()===st);
  if(q) rows=rows.filter(r=> norm(r.name).includes(q));

  rows.sort((a,b)=>{
    const ka = agencyOrderKey((a.agency||'').trim(), priorityIndex);
    const kb = agencyOrderKey((b.agency||'').trim(), priorityIndex);
    if(ka[0] !== kb[0]) return ka[0]-kb[0];
    if(ka[0] === 0){ // both in priority
      if(ka[1] !== kb[1]) return ka[1]-kb[1];
    }else if(ka[0] === 1){ // both others -> Thai by agency
      const t = byThai((a.agency||''),(b.agency||''));
      if(t !== 0) return t;
    }
    // secondary: room then name
    const r = byThai((a.room||'')+'',(b.room||'')+'');
    if(r !== 0) return r;
    return byThai((a.name||''),(b.name||''));
  });

  const grid=document.getElementById('grid'); grid.innerHTML='';
  rows.forEach(r=>{
    const stay=r.stay?` (${r.stay})`:'';
    const partner=r.partner?`<div class="pair">‡∏û‡∏±‡∏Å‡∏Ñ‡∏π‡πà‡∏Å‡∏±‡∏ö: ${r.partner}${r.partner_agency?`\n${r.partner_agency}`:''}</div>`:'';
    const roomHTML=r.no_stay?`<span class="pill pill-gray">‡πÑ‡∏°‡πà‡∏û‡∏±‡∏Å</span>`:((r.room&&r.room.trim())?`<span class="pill">‡∏´‡πâ‡∏≠‡∏á ${r.room}</span>`:`<span class="pill">‡∏´‡πâ‡∏≠‡∏á ‡∏£‡∏≠ <b>(‡πÄ‡∏Ç‡πâ‡∏≤‡∏û‡∏±‡∏Å 3-5)</b></span>`);
    const buildingHTML=(r.building&&r.building.trim())?`<span class="pill">‡∏≠‡∏≤‡∏Ñ‡∏≤‡∏£: ${r.building}</span>`:'';
    const checkinHTML=(r.checkin&&r.checkin.trim())?`<span class="pill pill-gray">Check in: ${r.checkin}</span>`:'';
    grid.insertAdjacentHTML('beforeend',`<div class="card">
      <div class="name">${r.name||'(‡πÑ‡∏°‡πà‡∏£‡∏∞‡∏ö‡∏∏‡∏ä‡∏∑‡πà‡∏≠)'}${stay}</div>
      <div class="meta">${r.agency||''}</div>
      ${r.ptype?`<div class="meta">${r.ptype}</div>`:''}
      ${partner}
      <div class="pills">${roomHTML}${buildingHTML?` ${buildingHTML}`:''}${checkinHTML?` ${checkinHTML}`:''}</div>
    </div>`);
  });
  document.getElementById('count').textContent = `‡∏û‡∏ö ${rows.length.toLocaleString('th-TH')} ‡∏£‡∏≤‡∏¢‡∏Å‡∏≤‡∏£`;
}

['input','change'].forEach(ev=>{

  document.getElementById('stay').addEventListener(ev,render);
});
